"use strict";(self.webpackChunkdq_website=self.webpackChunkdq_website||[]).push([[9520],{5444:(e,n,r)=>{r.r(n),r.d(n,{assets:()=>d,contentTitle:()=>i,default:()=>g,frontMatter:()=>s,metadata:()=>a,toc:()=>o});var t=r(7624),l=r(2172);const s={sidebar_position:3},i="Generelle avtalevilk\xe5r",a={id:"legal/terms",title:"Generelle avtalevilk\xe5r",description:"Sist oppdatert: 27 februar 2024",source:"@site/docs/legal/terms.md",sourceDirName:"legal",slug:"/legal/terms",permalink:"/docs/legal/terms",draft:!1,unlisted:!1,tags:[],version:"current",sidebarPosition:3,frontMatter:{sidebar_position:3},sidebar:"tutorialSidebar",previous:{title:"Personvernerkl\xe6ring",permalink:"/docs/legal/privacy-policy"},next:{title:"Avtale om Tjenesteniv\xe5 (SLA)",permalink:"/docs/legal/sla"}},d={},o=[{value:"1. Leverand\xf8rens ansvar for sine ytelser",id:"1-leverand\xf8rens-ansvar-for-sine-ytelser",level:2},{value:"2. Krav til tjenesteniv\xe5er",id:"2-krav-til-tjenesteniv\xe5er",level:2},{value:"3. Revisjon",id:"3-revisjon",level:2},{value:"4. Endringer i milj\xf8er",id:"4-endringer-i-milj\xf8er",level:2},{value:"5. Kundens forpliktelser",id:"5-kundens-forpliktelser",level:2},{value:"6. Vederlag og betalingsbestemmelser",id:"6-vederlag-og-betalingsbestemmelser",level:2},{value:"7. Avvikling av avtalen",id:"7-avvikling-av-avtalen",level:2},{value:"8. Personopplysninger",id:"8-personopplysninger",level:2},{value:"9. Eiendoms- og disposisjonsrett",id:"9-eiendoms--og-disposisjonsrett",level:2},{value:"9.1. Partenes rettigheter",id:"91-partenes-rettigheter",level:3},{value:"9.2. Tilh\xf8rende ansvar",id:"92-tilh\xf8rende-ansvar",level:3},{value:"9.3. Eiendomsrett til data",id:"93-eiendomsrett-til-data",level:3},{value:"10. Leverand\xf8rens mislighold",id:"10-leverand\xf8rens-mislighold",level:2},{value:"10.1. Avhjelp",id:"101-avhjelp",level:3},{value:"11. Rekonstruksjon av data",id:"11-rekonstruksjon-av-data",level:2},{value:"12. Kundens mislighold",id:"12-kundens-mislighold",level:2},{value:"13. Erstatning",id:"13-erstatning",level:2},{value:"13.1. Ansvarsomfang",id:"131-ansvarsomfang",level:3},{value:"13.2. Ansvarsbegrensning",id:"132-ansvarsbegrensning",level:3},{value:"14. Heving",id:"14-heving",level:2},{value:"15. Rettslige mangler",id:"15-rettslige-mangler",level:2},{value:"16. Diverse",id:"16-diverse",level:2},{value:"16.1. Tilegnet kompetanse",id:"161-tilegnet-kompetanse",level:3},{value:"16.2. Atskillelse av data",id:"162-atskillelse-av-data",level:3},{value:"16.3. Risiko",id:"163-risiko",level:3},{value:"16.4. Forsikringer",id:"164-forsikringer",level:3},{value:"16.5. Suspensjon av partenes rettigheter og plikter",id:"165-suspensjon-av-partenes-rettigheter-og-plikter",level:3},{value:"16.6. Taushetsplikt",id:"166-taushetsplikt",level:3},{value:"16.7. Konkurs, akkord e.l.",id:"167-konkurs-akkord-el",level:3},{value:"16.8. Overdragelse av rettigheter og plikter",id:"168-overdragelse-av-rettigheter-og-plikter",level:3},{value:"16.9. Rettsvalg",id:"169-rettsvalg",level:3},{value:"16.10. Tvistel\xf8sning og verneting",id:"1610-tvistel\xf8sning-og-verneting",level:3}];function v(e){const n={em:"em",h1:"h1",h2:"h2",h3:"h3",p:"p",...(0,l.M)(),...e.components};return(0,t.jsxs)(t.Fragment,{children:[(0,t.jsx)(n.h1,{id:"generelle-avtalevilk\xe5r",children:"Generelle avtalevilk\xe5r"}),"\n",(0,t.jsx)(n.p,{children:(0,t.jsx)(n.em,{children:"Sist oppdatert: 27 februar 2024"})}),"\n",(0,t.jsx)(n.p,{children:"Disse generelle avtalevilk\xe5rene gjelder for deg som kunde (heretter kalt Kunden) og DigiQuip AS, org. nr. 923 673 911 (heretter kalt Leverand\xf8ren), ved avtale om tilgang til DigiQuip digitale tjeneste (heretter kalt Hovedavtalen)."}),"\n",(0,t.jsx)(n.h2,{id:"1-leverand\xf8rens-ansvar-for-sine-ytelser",children:"1. Leverand\xf8rens ansvar for sine ytelser"}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8rens ytelser skal p\xe5 en helhetlig m\xe5te dekke de funksjoner og krav som er spesifisert i Hovedavtalen."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal s\xf8rge for at det personalet som utf\xf8rer tjenestene har den n\xf8dvendige kompetanse og har f\xe5tt tilstrekkelig innf\xf8ring i tjenestenes innhold og tilh\xf8rende tjenesteniv\xe5er."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal gi Kunden opplysninger av forebyggende karakter om eventuelle spesielle forhold knyttet til sin ytelse, som kan v\xe6re av betydning for \xe5 unng\xe5 feilsituasjoner, driftsstans og tap. Leverand\xf8ren har ogs\xe5 en varslingsplikt n\xe5r det er fare for at slike situasjoner kan inntreffe."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren kan benytte underleverand\xf8rer for leveranse av tjenestene i avtalen. Slike underleverand\xf8rer er oppgitt i Hovedavtalen. Ved behov for \xe5 skifte ut underleverand\xf8rer vil Kunden varsles i god tid."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren plikter \xe5 samarbeide med tredjepart i den utstrekning Kunden finner dette n\xf8dvendig for utf\xf8relsen av arbeidsoppgavene angitt i denne avtalen. Samarbeid med tredjepart utf\xf8res som timebasert oppdrag."}),"\n",(0,t.jsx)(n.h2,{id:"2-krav-til-tjenesteniv\xe5er",children:"2. Krav til tjenesteniv\xe5er"}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren har ansvaret for at tjenestene og tjenesteniv\xe5er er i henhold til Hovedavtalen."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren er ikke ansvarlig for manglende oppfyllelse av tjenesteniv\xe5 hvis dette er for\xe5rsaket av feil eller stans i kundens applikasjoner, eller hvis det er for\xe5rsaket av feil i standardprogramvare som er lisensiert fra tredjepart som Leverand\xf8ren er avhengig av for \xe5 levere tjenestene, og Leverand\xf8ren ikke kan lastes for ikke \xe5 ha tatt rimelige forholdsregler."}),"\n",(0,t.jsx)(n.h2,{id:"3-revisjon",children:"3. Revisjon"}),"\n",(0,t.jsx)(n.p,{children:"Kunden har rett til \xe5 foreta revisjon og verifikasjon av at Leverand\xf8ren overholder avtalte forpliktelser for Hovedavtalen."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal yte bistand hvis Kunden har behov for \xe5 involvere Leverand\xf8ren i gjennomf\xf8ring av kvalitetsrevisjoner eller andre gjennomganger av aspekter ved tjenestene, for eksempel i forbindelse med Kundens etterlevelse av rettslige krav eller med at Kunden sertifiserer seg. Leverand\xf8ren kan kreve vederlag for dette som fastsatt i Hovedavtalen."}),"\n",(0,t.jsx)(n.p,{children:"Tidspunkt og metode for gjennomf\xf8ring av revisjon og bistand avtales i det enkelte tilfellet. Revisjon kan maksimalt gjennomf\xf8res 1 gang per \xe5r. Dette er likevel ikke til hinder for \xe5 f\xe5 gjennomf\xf8rt innsyn og revisjon som er n\xf8dvendig for \xe5 oppfylle konkrete p\xe5legg fra offentlig tilsynsmyndighet. Kunden skal gi Leverand\xf8ren rimelig varsel om revisjon og Leverand\xf8ren skal akseptere revisjon innen rimelig tid. Revisjonen skal gjennomf\xf8res p\xe5 en slik m\xe5te at den i minst mulig grad forstyrrer alminnelig drift og tjenesteleveranser fra Leverand\xf8ren og dennes underleverand\xf8rer."}),"\n",(0,t.jsx)(n.p,{children:"Dersom revisjonen avdekker at avtalevilk\xe5r eller rettslige krav Leverand\xf8ren svarer for ikke overholdes, plikter Leverand\xf8ren \xe5 endre tjenestene p\xe5 en slik m\xe5te at avtalevilk\xe5rene oppfylles."}),"\n",(0,t.jsx)(n.h2,{id:"4-endringer-i-milj\xf8er",children:"4. Endringer i milj\xf8er"}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren kan gjennomf\xf8re endringer i plattformen for \xe5 \xf8ke ytelse eller sikkerhet."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal holde Kunden orientert om endringer som kan ha betydning for Kundens bruk av tjenestene eller for sikkerheten i l\xf8sningen f\xf8r endringene iverksettes."}),"\n",(0,t.jsx)(n.h2,{id:"5-kundens-forpliktelser",children:"5. Kundens forpliktelser"}),"\n",(0,t.jsx)(n.p,{children:"Kunden plikter \xe5 samarbeide med Leverand\xf8ren om gjennomf\xf8ringen av denne avtalen, slik at Leverand\xf8ren ikke blir forsinket eller p\xe5 annen m\xe5te forhindret i \xe5 oppfylle sine forpliktelser."}),"\n",(0,t.jsx)(n.p,{children:"Kunden skal beskytte, forsvare og holde Leverand\xf8ren borte fra alle krav for tap eller skader basert p\xe5 bruk, misbruk eller uautorisert tilgang av passord eller n\xf8kler."}),"\n",(0,t.jsx)(n.p,{children:"Kunden plikt \xe5 betale de vederlag som er oppgitt i Hovedavtalen."}),"\n",(0,t.jsx)(n.h2,{id:"6-vederlag-og-betalingsbestemmelser",children:"6. Vederlag og betalingsbestemmelser"}),"\n",(0,t.jsx)(n.p,{children:"Fakturering skjer m\xe5nedlig forskuddsvis. Hvis Kunden ikke betaler til avtalt tid, har Leverand\xf8ren krav p\xe5 rente av det bel\xf8p som er forfalt til betaling, i henhold til lov 17. desember 1976 nr. 100 om renter ved forsinket betaling m.m. (forsinkelsesrenteloven)."}),"\n",(0,t.jsx)(n.p,{children:"Hvis forfalt vederlag med tillegg av forsinkelsesrenter ikke er betalt innen 30 (tretti) kalenderdager fra forfall, kan Leverand\xf8ren sende Kunden skriftlig varsel om at avtalen vil bli hevet, hvis oppgj\xf8r ikke er skjedd innen 60 (seksti) kalenderdager etter at varselet er mottatt."}),"\n",(0,t.jsx)(n.p,{children:"Heving kan ikke skje hvis Kunden gj\xf8r opp forfalt vederlag med tillegg av forsinkelsesrenter f\xf8r fristens utl\xf8p"}),"\n",(0,t.jsx)(n.p,{children:"Virkningen av endringer i direkte lisensavgifter, offentlige avgifter og/eller p\xe5legg om endring i praktisering av lover og forskrifter vedr\xf8rende slike avgifter, vil bli belastet Kunden."}),"\n",(0,t.jsx)(n.p,{children:"Betaling skal skje i henhold til faktura pr 14 dager, om ikke annen forfallstid er avtalt."}),"\n",(0,t.jsx)(n.p,{children:"Avtalens priser kan endres \xe5rlig per 1. januar hvert \xe5r, begrenset til \xf8kningen i SSB sin relevante prisindeks siden prisene sist ble fastsatt. Prisendring skal varsles med en frist p\xe5 30 dager."}),"\n",(0,t.jsx)(n.h2,{id:"7-avvikling-av-avtalen",children:"7. Avvikling av avtalen"}),"\n",(0,t.jsx)(n.p,{children:"Ved oppsigelse eller utl\xf8p av Hovedavtalen skal Kunden avvikle bruken av den lisensierte programvaren og maskinvare og returnere eller gi bekreftelse p\xe5 sletting av eventuell konfidensiell informasjon de besitter."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal umiddelbart gi flytteadgang til Kundens lagrede data og egeneide lisenser. Bistand til flytting av data kan gjennomf\xf8res mot vederlag time-for-time."}),"\n",(0,t.jsx)(n.h2,{id:"8-personopplysninger",children:"8. Personopplysninger"}),"\n",(0,t.jsx)(n.p,{children:"I tilfeller der personopplysninger skal behandles i denne avtalen, gjelder Databehandleravtalens reguleringer."}),"\n",(0,t.jsx)(n.h2,{id:"9-eiendoms--og-disposisjonsrett",children:"9. Eiendoms- og disposisjonsrett"}),"\n",(0,t.jsx)(n.h3,{id:"91-partenes-rettigheter",children:"9.1. Partenes rettigheter"}),"\n",(0,t.jsx)(n.p,{children:"Denne avtalen endrer ikke de opphavs-, disposisjons- eller eiendomsrettighetene partene hadde f\xf8r avtalen, og som de beholder under gjennomf\xf8ringen av avtalen."}),"\n",(0,t.jsx)(n.p,{children:"Denne bestemmelsen gj\xf8r ikke inngrep i reglene om taushetsplikt."}),"\n",(0,t.jsx)(n.h3,{id:"92-tilh\xf8rende-ansvar",children:"9.2. Tilh\xf8rende ansvar"}),"\n",(0,t.jsx)(n.p,{children:"Hver av partene har ansvar for at de har de n\xf8dvendige autorisasjoner og rettigheter mv. i forhold til maskinvare, infrastruktur, programvare og dokumentasjon som de benytter i avtaleforholdet. Hvis en av partene vil benytte utstyr eller programvare mv. som parten ikke selv eier eller har rettigheter til, skal parten s\xf8rge for at n\xf8dvendig godkjennelse i form av underliggende avtale med eier eller rettighetshaver foreligger f\xf8r slikt utstyr eller programvare mv. kan brukes for drift i henhold til denne avtalen."}),"\n",(0,t.jsx)(n.p,{children:"Hvis det foretas endringer, forbedringer eller lignende i forbindelse med tjenestene etter denne avtalen, har Leverand\xf8ren ansvaret for at Kunden f\xe5r den disposisjonsrett som er n\xf8dvendig for at utstyr og programmer fortsatt kan benyttes uten hinder av andres opphavsrett eller andre rettigheter."}),"\n",(0,t.jsx)(n.h3,{id:"93-eiendomsrett-til-data",children:"9.3. Eiendomsrett til data"}),"\n",(0,t.jsx)(n.p,{children:"Kunden (og dennes rettighetsgivere) beholder eiendomsrett til alle data som overlates til Leverand\xf8ren for behandling og som lagres eller prosesseres ved hjelp av ytelsene under denne avtalen. Det samme gjelder resultatet av Leverand\xf8rens behandling av slike data."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren har tilgang til data som nevnt ovenfor utelukkende i den utstrekning som er n\xf8dvendig for at Leverand\xf8ren skal kunne oppfylle sine forpliktelser i henhold til avtalen."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren har ikke under noen omstendighet rett til \xe5 ut\xf8ve tilbakeholdsrett i Kundens data."}),"\n",(0,t.jsx)(n.h2,{id:"10-leverand\xf8rens-mislighold",children:"10. Leverand\xf8rens mislighold"}),"\n",(0,t.jsx)(n.p,{children:"Det foreligger mislighold fra Leverand\xf8rens side hvis tjenestene ikke er i samsvar med de funksjoner, krav og frister som er avtalt. Det foreligger ogs\xe5 mislighold dersom Leverand\xf8ren ikke oppfyller \xf8vrige plikter etter avtalen."}),"\n",(0,t.jsx)(n.p,{children:"Det foreligger likevel ikke mislighold hvis situasjonen skyldes Kundens forhold eller force majeure."}),"\n",(0,t.jsx)(n.p,{children:"Kunden skal reklamere skriftlig uten ugrunnet opphold."}),"\n",(0,t.jsx)(n.p,{children:"Ved mislighold kan Kunden holde betalingen tilbake, men ikke \xe5penbart mer enn det som er n\xf8dvendig for \xe5 sikre Kundens krav som f\xf8lge av misligholdet."}),"\n",(0,t.jsx)(n.h3,{id:"101-avhjelp",children:"10.1. Avhjelp"}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal p\xe5begynne og gjennomf\xf8re arbeidet med \xe5 avhjelpe misligholdet uten ugrunnet opphold."}),"\n",(0,t.jsx)(n.p,{children:"Det er et m\xe5l for avhjelpen at ytelsen skal oppfylle de avtalte krav og spesifikasjoner, og at leveransen skal fungere som avtalt. Avhjelp kan for eksempel skje ved utbedring, omlevering eller tilleggslevering."}),"\n",(0,t.jsx)(n.h2,{id:"11-rekonstruksjon-av-data",children:"11. Rekonstruksjon av data"}),"\n",(0,t.jsx)(n.p,{children:"I tilfelle av tap eller \xf8deleggelse av data, skal Leverand\xf8ren uten ugrunnet opphold gjenopprette disse og om n\xf8dvendig rekonstruere data. Hvis \xe5rsaken til tap av data er slik at Kunden skal betale for rekonstruksjonen, skal Leverand\xf8ren avklare omfanget med Kunden f\xf8r arbeidet p\xe5begynnes."}),"\n",(0,t.jsx)(n.p,{children:"Hvis rekonstruksjon er n\xf8dvendig for at Kundens l\xf8sning skal fungere i ordin\xe6r drift, skal arbeidet p\xe5begynnes uten ugrunnet opphold, mens avklaring av omfanget p\xe5g\xe5r. I den utstrekning tap eller korrupsjon skyldes forhold Leverand\xf8ren har ansvaret for skal gjenoppretting og rekonstruering skje uten ytterligere vederlag."}),"\n",(0,t.jsx)(n.p,{children:"Dersom det er umulig for Leverand\xf8ren alene \xe5 rekonstruere data, skal data i tilfelle som nevnt ovenfor, rekonstrueres i samarbeid mellom partene, eller ved hjelp av tredjepart. Hvis Kundens personale helt eller delvis forest\xe5r rekonstruksjonen, skal Leverand\xf8ren dekke de direkte l\xf8nnskostnader og andre direkte kostnader som p\xe5l\xf8per samt direkte kostnader dersom tredjepart benyttes til arbeidet og eventuelle andre direkte kostnader som er forbundet med rekonstrueringen i den utstrekning tap eller \xf8deleggelse av data skyldes forhold Leverand\xf8ren har ansvaret for."}),"\n",(0,t.jsx)(n.p,{children:"I tilfelle av tap eller \xf8deleggelse av data som skyldes forhold p\xe5 Kundens side, skal Kunden dekke Leverand\xf8rens dokumenterte merkostnader som slike forhold m\xe5tte medf\xf8re. Dette gjelder likevel ikke dersom rekonstrueringen blir vanskeligere eller mer tidkrevende som f\xf8lge av at Leverand\xf8ren ikke har fulgt de rutiner for sikkerhetskopiering som er avtalt. I de tilfeller Kunden skal dekke Leverand\xf8rens merkostnader skal Leverand\xf8ren holde Kunden l\xf8pende orientert om hvilke kostnader som p\xe5dras, og Kunden skal ha rett til \xe5 p\xe5legge Leverand\xf8ren \xe5 stanse arbeidet med rekonstruksjonen."}),"\n",(0,t.jsx)(n.h2,{id:"12-kundens-mislighold",children:"12. Kundens mislighold"}),"\n",(0,t.jsx)(n.p,{children:"Det foreligger mislighold fra Kundens side hvis Kunden ikke oppfyller sine plikter etter avtalen."}),"\n",(0,t.jsx)(n.p,{children:"Det foreligger likevel ikke mislighold hvis situasjonen skyldes Leverand\xf8rens forhold eller force majeure."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal reklamere skriftlig uten ugrunnet opphold etter at misligholdet er oppdaget eller burde v\xe6rt oppdaget."}),"\n",(0,t.jsx)(n.h2,{id:"13-erstatning",children:"13. Erstatning"}),"\n",(0,t.jsx)(n.h3,{id:"131-ansvarsomfang",children:"13.1. Ansvarsomfang"}),"\n",(0,t.jsx)(n.p,{children:"En part kan kreve erstatning for det direkte, dokumenterte tap han lider som er en p\xe5regnelig f\xf8lge av mislighold fra den annen parts side. Dette gjelder ikke dersom den misligholdende part kan godtgj\xf8re at misligholdet eller \xe5rsaken til misligholdet ikke kan tilskrives ham. Den skadelidte part skal bidra til \xe5 klarlegge grunn til misligholdet og skal varsle den annen part dersom det settes i gang tiltak som kan p\xe5f\xf8re den annen part erstatningsansvar."}),"\n",(0,t.jsx)(n.p,{children:"Erstatningsansvaret omfatter under enhver omstendighet ikke indirekte tap eller f\xf8lgetap, s\xe5 som tap som f\xf8lge av driftsavbrudd, f\xf8lger av tapte data, tapte inntekter, tapt fortjeneste, tapt effektiviseringsgevinst, tap hos tredjepart eller lignende."}),"\n",(0,t.jsx)(n.p,{children:"Det kan ikke kreves erstatning for forhold som gir den skadelidte part rett til erstatning i henhold til annen avtale mellom partene."}),"\n",(0,t.jsx)(n.h3,{id:"132-ansvarsbegrensning",children:"13.2. Ansvarsbegrensning"}),"\n",(0,t.jsx)(n.p,{children:"Ethvert mulig erstatningsansvar under Hovedavtalen, for enkelttilfeller eller gjentatte tilfeller innenfor samme kalender\xe5r, er under enhver omstendighet oppad begrenset totalt \xe5rlig vederlag for avtalen beregnet siste m\xe5neds vederlag x 12. Denne begrensningen gjelder imidlertid ikke dersom den misligholdende part eller noen han er ansvarlig for har utvist forsett eller grov uaktsomhet."}),"\n",(0,t.jsx)(n.h2,{id:"14-heving",children:"14. Heving"}),"\n",(0,t.jsx)(n.p,{children:"Dersom en part vesentlig misligholder sine forpliktelser etter Avtalen, kan den skadelidte part med 30 kalenderdagers skriftlig varsel heve avtalen. Retten til heving bortfaller dersom misligholdet er opph\xf8rt eller avhjulpet i l\xf8pet av denne perioden."}),"\n",(0,t.jsx)(n.p,{children:"Dersom forfalt vederlag med tillegg av renter ikke er betalt innen 30 dager fra forfall, kan Leverand\xf8ren sende Kunden skriftlig varsel om at Hovedavtalen vil bli hevet dersom oppgj\xf8r ikke er skjedd innen 30 dager etter at Kunden mottok varslet. Heving kan ikke skje dersom Kunden gj\xf8r opp forfalt vederlag med tillegg av renter f\xf8r fristens utl\xf8p."}),"\n",(0,t.jsx)(n.h2,{id:"15-rettslige-mangler",children:"15. Rettslige mangler"}),"\n",(0,t.jsx)(n.p,{children:"Hver av partene har risikoen og ansvaret for at deres ytelser ikke krenker tredjeparters opphavsrett eller andre immaterielle rettigheter. Hvis ytelsen medf\xf8rer slik krenkelse, foreligger en rettsmangel."}),"\n",(0,t.jsx)(n.p,{children:"Hvis en tredjepart gj\xf8r gjeldende mot en av partene at driftstjenesten medf\xf8rer rettsmangel, skal den andre parten informeres skriftlig snarest mulig."}),"\n",(0,t.jsx)(n.p,{children:"Den ansvarlige parten skal for egen regning h\xe5ndtere kravet. Den andre parten skal i rimelig utstrekning bist\xe5 parten med dette."}),"\n",(0,t.jsx)(n.p,{children:"En part skal p\xe5begynne og gjennomf\xf8re arbeidet med \xe5 avhjelpe rettsmangler uten ugrunnet opphold ved \xe5 s\xf8rge for at den andre parten kan bruke ytelsen som f\xf8r, uten \xe5 krenke tredjeparts rettigheter, eller \xe5 levere annen tilsvarende ytelse som ikke krenker andres rettigheter."}),"\n",(0,t.jsx)(n.h2,{id:"16-diverse",children:"16. Diverse"}),"\n",(0,t.jsx)(n.h3,{id:"161-tilegnet-kompetanse",children:"16.1. Tilegnet kompetanse"}),"\n",(0,t.jsx)(n.p,{children:"Kunden erkjenner at Leverand\xf8ren tilbyr profesjonelle tjenester, overv\xe5king, konfigurering og testing av tjenester for andre parter, og godtar at ingenting i avtalen anses eller oppfattes \xe5 hindre Leverand\xf8ren \xe5 gjennomf\xf8re slik tjenester for andre."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren har rett til \xe5 bruke teknikker, metoder, verkt\xf8y, ideer og perfeksjonere og fremme sin egen virksomhet."}),"\n",(0,t.jsx)(n.h3,{id:"162-atskillelse-av-data",children:"16.2. Atskillelse av data"}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal iverksette tilstrekkelige tiltak for \xe5 sikre konfidensialitet av alle data, herunder tiltak for \xe5 sikre at data ikke kommer p\xe5 avveie og for \xf8vrig \xe5 sikre mot innsyn fra uvedkommende. Videre skal det iverksettes n\xf8dvendige tiltak for \xe5 sikre mot utilsiktet endring og sletting av data og mot angrep av virus og annen skadevoldende programvare."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren plikter \xe5 holde Kundens data logisk atskilt fra eventuelle tredjeparters data for \xe5 eliminere faren for beskadigelse av data og/eller innsyn i data. Med logisk atskilt forst\xe5s at n\xf8dvendige tekniske tiltak som sikrer data mot u\xf8nsket endring og innsyn er iverksatt og opprettholdt. Som u\xf8nsket endring og innsyn anses ogs\xe5 tilgang fra ansatte hos Leverand\xf8ren eller andre som ikke har behov for informasjonen i sitt arbeid for Kunden."}),"\n",(0,t.jsx)(n.h3,{id:"163-risiko",children:"16.3. Risiko"}),"\n",(0,t.jsx)(n.p,{children:"Risiko for maskinvare, infrastruktur og programmer ligger til den part som fysisk har utstyret eller programmene hos seg, eller under sin kontroll."}),"\n",(0,t.jsx)(n.h3,{id:"164-forsikringer",children:"16.4. Forsikringer"}),"\n",(0,t.jsx)(n.p,{children:"Hvis Kunden er en offentlig virksomhet, st\xe5r Kunden som selvassurand\xf8r. Hvis Kunden ikke st\xe5r som selvassurand\xf8r, plikter Kunden \xe5 ha forsikringer som er tilstrekkelige til \xe5 dekke de kravene fra Leverand\xf8ren som f\xf8lger av Kundens risiko eller ansvar etter denne avtalen innenfor rammen av alminnelige forsikringsvilk\xe5r."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal ha forsikringer som er tilstrekkelige til \xe5 dekke de kravene fra Kunden som f\xf8lger av Leverand\xf8rens risiko eller ansvar etter denne avtalen innenfor rammen av alminnelige forsikringsvilk\xe5r. Denne forpliktelsen anses oppfylt dersom Leverand\xf8ren tegner ansvars- og risikoforsikring p\xe5 vilk\xe5r som anses som ordin\xe6re innenfor norsk forsikringsvirksomhet."}),"\n",(0,t.jsx)(n.p,{children:"Leverand\xf8ren skal p\xe5 foresp\xf8rsel fra Kunden redegj\xf8re for \xe5 dokumentere de av Leverand\xf8rens forsikringer som er relevante for oppfyllelse av denne bestemmelsen."}),"\n",(0,t.jsx)(n.h3,{id:"165-suspensjon-av-partenes-rettigheter-og-plikter",children:"16.5. Suspensjon av partenes rettigheter og plikter"}),"\n",(0,t.jsx)(n.p,{children:"Skulle det inntreffe en ekstraordin\xe6r situasjon som ligger utenfor partenes kontroll og som umuliggj\xf8r oppfyllelse av plikter etter Hovedavtalen, og som etter vanlige kontraktsrettslige prinsipper m\xe5 regnes som force majeure, skal motparten varsles om dette uten ugrunnet opphold. Den rammede parts forpliktelser suspenderes s\xe5 lenge den ekstraordin\xe6re situasjonen varer. Den annen parts motytelse suspenderes i samme tidsrom."}),"\n",(0,t.jsx)(n.p,{children:"Parten kan i force majeure-situasjoner bare g\xe5 fra avtalen med den rammede parts samtykke eller dersom situasjonen har vart eller antas \xe5 ville vare mer enn 90 dager, regnet fra det tidspunktet situasjonen inntrer, og da bare med 30 dagers varsel."}),"\n",(0,t.jsx)(n.p,{children:"Dersom Leverand\xf8ren er den rammede part og den ekstraordin\xe6re situasjonen kun rammer en del av Leverand\xf8rens tjenester, og dette ikke er til hinder for at Kunden kan nyttiggj\xf8re seg de \xf8vrige avtalte tjenester, skal bestemmelsene over i dette punkt kun gjelde de tjenester som rammes av force majeure-situasjonen."}),"\n",(0,t.jsx)(n.h3,{id:"166-taushetsplikt",children:"16.6. Taushetsplikt"}),"\n",(0,t.jsx)(n.p,{children:"Informasjon som partene blir kjent med i forbindelse med avtalen og gjennomf\xf8ringen av avtalen skal behandles konfidensielt, og ikke gj\xf8res tilgjengelig for utenforst\xe5ende uten samtykke fra den annen part."}),"\n",(0,t.jsx)(n.p,{children:"Hvis Kunden er en offentlig virksomhet, er taushetsplikt etter denne bestemmelsen ikke mer omfattende enn det som f\xf8lger av lov 10. februar 1967 om behandlingsm\xe5ten i forvaltningssaker (forvaltningsloven) eller tilsvarende sektorspesifikk regulering."}),"\n",(0,t.jsx)(n.p,{children:"Taushetsplikt etter denne bestemmelsen er ikke til hinder for utlevering av informasjon som kreves fremlagt i henhold til lov eller forskrift, herunder offentlighet og innsynsrett som f\xf8lger av lov 19. mai 2006 om rett til innsyn i dokument i offentleg verksemd (offentleglova). Om mulig, skal den annen part varsles f\xf8r slik informasjon gis."}),"\n",(0,t.jsx)(n.p,{children:"Taushetsplikten er ikke til hinder for at opplysningene brukes n\xe5r ingen berettiget interesse tilsier at de holdes hemmelig, for eksempel n\xe5r de er alminnelig kjent eller alminnelig tilgjengelig andre steder."}),"\n",(0,t.jsx)(n.p,{children:"Partene skal ta n\xf8dvendige forholdsregler for \xe5 sikre at uvedkommende ikke f\xe5r innsyn i eller kan bli kjent med taushetsbelagt informasjon."}),"\n",(0,t.jsx)(n.p,{children:"Taushetsplikten gjelder partenes ansatte, underleverand\xf8rer og tredjeparter som handler p\xe5 partenes vegne i forbindelse med gjennomf\xf8ring av avtalen. Partene kan bare overf\xf8re taushetsbelagt informasjon til slike underleverand\xf8rer og tredjeparter i den utstrekning dette er n\xf8dvendig for gjennomf\xf8ring av avtalen."}),"\n",(0,t.jsx)(n.p,{children:"Taushetsplikten er ikke til hinder for at partene kan utnytte erfaring og kompetanse som opparbeides i forbindelse med gjennomf\xf8ringen av avtalen."}),"\n",(0,t.jsx)(n.p,{children:"Taushetsplikten gjelder ogs\xe5 etter at avtalen er opph\xf8rt. Ansatte eller andre som fratrer sin tjeneste hos en av partene skal p\xe5legges taushetsplikt ogs\xe5 etter fratredelsen om forhold som nevnt ovenfor. Taushetsplikten opph\xf8rer fem (5) \xe5r etter leveringsdag, med mindre annet f\xf8lger av lov eller forskrift."}),"\n",(0,t.jsx)(n.h3,{id:"167-konkurs-akkord-el",children:"16.7. Konkurs, akkord e.l."}),"\n",(0,t.jsx)(n.p,{children:"Hvis det i forbindelse med Leverand\xf8rens virksomhet \xe5pnes gjeldsforhandlinger, akkord eller konkurs, eller annen form for kreditorstyring gj\xf8r seg gjeldende, har Kunden rett til \xe5 heve avtalen med \xf8yeblikkelig virkning, s\xe5 fremt ikke annet f\xf8lger av ufravikelig lov."}),"\n",(0,t.jsx)(n.h3,{id:"168-overdragelse-av-rettigheter-og-plikter",children:"16.8. Overdragelse av rettigheter og plikter"}),"\n",(0,t.jsx)(n.p,{children:"Partene kan overdra sine rettigheter og plikter etter avtalen med skriftlig samtykke fra den annen part. Slikt samtykke er ikke n\xf8dvendig ved overdragelse til et selskap innen samme konsern, ved fusjon eller ved fisjon der den ber\xf8rte part beholder dominerende innflytelse over selskapet. For \xf8vrig kan samtykke ikke nektes uten saklig grunn."}),"\n",(0,t.jsx)(n.h3,{id:"169-rettsvalg",children:"16.9. Rettsvalg"}),"\n",(0,t.jsx)(n.p,{children:"Partenes rettigheter og plikter etter Avtalen bestemmes i sin helhet av norsk rett."}),"\n",(0,t.jsx)(n.h3,{id:"1610-tvistel\xf8sning-og-verneting",children:"16.10. Tvistel\xf8sning og verneting"}),"\n",(0,t.jsx)(n.p,{children:"Dersom det oppst\xe5r tvist mellom partene om tolkningen eller rettsvirkningene av Avtalen, skal tvisten f\xf8rst s\xf8kes l\xf8st ved forhandlinger. F\xf8rer slike forhandlinger ikke fram innen to m\xe5neder regnet fra det tidspunkt tvisten oppsto, kan hver av partene forlange tvisten avgjort med endelig virkning ved domstolsbehandling."}),"\n",(0,t.jsx)(n.p,{children:"Follo og Nordre \xd8stfold tingrett vedtas som verneting."})]})}function g(e={}){const{wrapper:n}={...(0,l.M)(),...e.components};return n?(0,t.jsx)(n,{...e,children:(0,t.jsx)(v,{...e})}):v(e)}},2172:(e,n,r)=>{r.d(n,{I:()=>a,M:()=>i});var t=r(1504);const l={},s=t.createContext(l);function i(e){const n=t.useContext(s);return t.useMemo((function(){return"function"==typeof e?e(n):{...n,...e}}),[n,e])}function a(e){let n;return n=e.disableParentContext?"function"==typeof e.components?e.components(l):e.components||l:i(e.components),t.createElement(s.Provider,{value:n},e.children)}}}]);